import '../index.css'
import NavBar from './NavBar'
import Head from './Head'
import Foot from './Foot'

function Page() {
    return (
        <>
            <NavBar />
            <Head />
            <ul>
                <li>Was first released in 2013</li>
                <li>I am more likely to get a job as a front end developer if I know React</li>
            </ul>
            <Foot />
        </>
    );
}


export default Page;
